import axios from 'axios';
import React from "react";

class Checklog extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            messsage: ""
        }
    }
    
    componentWillMount() {
        this.getDataAxios();
   
    }
    getDataAxios = () => {
        const response = axios.get("http://localhost:3080/server/checklogin");
        this.setState({
            message: response.message,
        })
        console.log(response)
    }
    render(){
        return(
            <h1>{this.state.message}</h1>
        )
    }
}


export default Checklog;
